class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        res = []
        lw = len(words)
        ld = len(words[0])
        ls = len(s)
        word_count = {}
        for x in words:
            if word_count.get(x) == None:
                word_count[x] = 1
            else:
                word_count[x] += 1
        i = 0

        while i < ls - lw*ld+1:
            t_count = {}
            j = 0
            while j < lw:
                str = s[i+j*ld: i+(j+1)*ld]
                if word_count.get(str) == None:
                    break
                if t_count.get(str) == None:
                    t_count[str] = 1
                else:
                    t_count[str] += 1
                if t_count[str] > word_count[str]:
                    break
                j += 1
            if j == lw:
                res.append(i)
            i += 1
        
        return res

